import React, {useState} from 'react';
import axios from 'axios';


//Url
import { bookingUrl } from '../../../settings';
import { StyledBookingInput, StyledBookingForm, StyledButton, MyBody } from '../BookingEndpoint/Booking.styles';

const initialState = {
    bookingDate: "",
    duration: ""
}

function BookCar() {
    const [response, setResponse] = useState('');
    const [booking, setbooking] = useState({});


    const handleBookingChange = (e) => {
        setbooking({
            ...booking,
            [e.target.id]: e.target.value,
        });
        console.log(bookingUrl)
    };

const handleSubmit = (e) =>{
    e.preventDefault();
    axios.post(`${bookingUrl}`, booking)
    .then((response) => {
        setResponse(response.data);
    }      
    
)};

return (
    <MyBody>
        
        <StyledBookingForm>
            Book your car wash here
            <StyledBookingInput 
            type="String"
            id='registration'
            value={car.registration}
            onChange={handleBookingChange}
            ></StyledBookingInput>
        
            <StyledBookingInput
                type="String"
                placeholder="Brand of ar"
                id='brand'
                value={car.brand}
                onChange={handleBookingChange}
            ></StyledBookingInput>

            <StyledBookingInput
                type="String"
                placeholder="Make of car"
                id='make'
                value={car.make}
                onChange={handleBookingChange}
            ></StyledBookingInput>

            <StyledBookingInput
                type="String"
                placeholder="year"
                id='year'
                value={car.year}
                onChange={handleBookingChange}
            ></StyledBookingInput>

            <StyledButton onClick={handleSubmit}>
            Confirm      
            </StyledButton>
        </StyledBookingForm>
    </MyBody>
    );
}

export default BookCar;
